import { Form, Input } from '@rocketseat/unform';
import { Container } from './styles';

export default function Profile() {
  return (
    <Container>
      <Form>
        <Input name="name" placeholder="Nome COmpleto" />
        <Input name="email" placeholder="Seu E-mail" />

        <hr />
      </Form>
    </Container>
  );
}
